// import katieZaferes from "../src/images/katie-zaferes.png"
import Data from "./data"

export default function App() {
console.log(Data)

const datum = Data.map(item => {
  return (
    <Card
      img="/images/katie-zaferes.png"
      img_alt="katie zaferes"
      rating={5.0}
      reviewCount={6}
      country="USA"
      title={item.title}
      price={item.location}
    />
  )
})

return (
  <div>
    <Navbar/>
    {datum}
  </div>
)}

